import React from "react";
import "./componentStyles/SelectSearch.css";
import { faAngleDown } from "@fortawesome/free-solid-svg-icons";

const SelectSearch = () => {
  return (
    <div className="selectSearch-container">
      <form className="form-container">
        <select className="filter-1">
          <option>Used Cars</option>
          <FontAwesomeIcon icon={faAngleDown} />
        </select>
        <select className="filter-2">
          <option>Any Makes</option>
          <FontAwesomeIcon icon={faAngleDown} />
        </select>
        <select className="filter-3">
          <option>Any Models </option>
          <FontAwesomeIcon icon={faAngleDown} />
        </select>
        <select className="filter-4">
          <option>All Prices</option>
          <FontAwesomeIcon icon={faAngleDown} />
        </select>
        <button type="submit">Search Icon</button>
      </form>
    </div>
  );
};

export default SelectSearch;
